import React from 'react';

function SchoolInfo() {
  return (
    <section id="info">
      <h2>School Information</h2>
      <p>Jahanara Israil School & College is a prestigious institution located in Barishal, Bangladesh.</p>
      <ul>
        <li>Founded: 2010</li>
        <li>Founder: Saleh M. Shelly</li>
        <li>Address: 999 College Row, Barishal 8200</li>
      </ul>
    </section>
  );
}

export default SchoolInfo;
